import React from "react";
import Link from "next/link";

import { Menu, Button } from "antd";
import {
  HomeOutlined,
  AppstoreOutlined,
  SettingOutlined,
  SmileOutlined
} from "@ant-design/icons";
const { SubMenu } = Menu;

const Nav = ({ categories }) => {
  return (
    <Menu mode="horizontal">
      <Menu.Item key="mail" icon={<HomeOutlined />}>
        <Link href="/">
          <a>Home</a>
        </Link>
      </Menu.Item>
      <Menu.Item key="app" icon={<SmileOutlined />}>
        <Link href="/about">
          <a>About</a>
        </Link>
      </Menu.Item>
      <SubMenu key="SubMenu" icon={<SettingOutlined />} title="Categories">
        <Menu.ItemGroup>
          {categories.map((category) => {
            return (
              // <li key={category.id}>
              <Menu.Item key="setting:1">
                <Link as={`/category/${category.id}`} href="/category/[id]">
                  <a>{category.name}</a>
                </Link>
              </Menu.Item>
            );
          })}
        </Menu.ItemGroup>
      </SubMenu>
    </Menu>
  );
};

export default Nav;

